import React from "react";

export default function Contact() {
  const style = {
    container: {
      textAlign: "center",
      color: "white",
    },
    h1: {
      paddingTop: "25px",
    },
  };
  return (
    <div style={style.container}>
      <h1>CONTACT</h1>
      <p>Contact Page Here</p>
    </div>
  );
}
